import { useEffect } from "react";
import { useDispatch } from "react-redux";
import { fetch20Pokemons } from "./components/store/pokemon-actions";
import "./App.css";

function App() {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(fetch20Pokemons());
  }, [dispatch]);

  return <div> </div>;
}

export default App;
